const webInterface = `
<html>
    <title>Codeometer</title>
    <head>
        <meta charset="UTF-8">
    </head>

    <style>
        h1 {
            text-shadow: 2px 2px black;
        }
        .info {
            background: gray;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
        .error {
            background: red;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
        .copyright {
            display: table;
            width: 100%;
            height: 1px;
        }
        .copyright-disclaimer {
            position: absolute;
            bottom: 20px;
            height: 1px;
            align: center;
            display: table-cell;
            font-size: 11px;
            text-align: right;
            font-family: Courier;
        }
        .wait {
            width: 100%;
            height: 100%;
            background: gray;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
    </style>

    <script>
        function doRequest(vdoc, userData, method) {
            try {
                var form = document.createElement("form");
                form.method = method;
                form.action = vdoc;
                for (let k in userData) {
                    if (userData.hasOwnProperty(k)) {
                        const field = document.createElement("input");
                        field.type = "hidden";
                        field.name = k;
                        field.value = userData[k];
                        form.appendChild(field);
                    }
                }
                chkEstimatives = document.getElementById("chkEstimatives");
                fieldEstimatives = document.createElement("input");
                fieldEstimatives.type = "hidden";
                fieldEstimatives.name = "estimatives";
                if (chkEstimatives.checked) {
                    fieldEstimatives.value = "1";
                } else {
                    fieldEstimatives.value = "0";
                }
                form.appendChild(fieldEstimatives);
                fieldStatsPerFile = document.createElement("input");
                fieldStatsPerFile.type = "hidden";
                fieldStatsPerFile.name = "statsPerFile";
                if (chkEstimatives.checked) {
                    fieldStatsPerFile.value = "1";
                } else {
                    fieldStatsPerFile.value = "0";
                }
                form.appendChild(fieldStatsPerFile);
                document.body.appendChild(form);
                form.submit();
                document.getElementById("mainDiv").style.display = "none";
                document.getElementById("waitDiv").style.display = "block";
            } catch(e) {
                document.getElementById("console").className="error";
                document.getElementById("console").innerHTML = e.toString();
            }
        }
        function doUrlMeasure() {
            edtQuery = document.getElementById("edtQuery");
            if (edtQuery.value.length > 0) {
                doRequest("/codeometer", { "src" : edtQuery.value }, "post");
            }
        }
        function doFileMeasure() {
            try {
                btnBrowse = document.getElementById("btnBrowse");
                btnBrowse.onchange = function () {
                    if (btnBrowse.files.length == 0) {
                        return;
                    }
                    var file = btnBrowse.files[0];
                    var reader = new FileReader();
                    if (btnBrowse.value.endsWith(".zip")) {
                        reader.readAsBinaryString(file);
                    } else {
                        reader.readAsText(file);
                    }
                    reader.addEventListener("load", function (e) {
                                                        doRequest("/codeometer", { "src" : btnBrowse.value,
                                                                                   "data" : window.btoa(e.target.result)}, "post")
                                                    });
                }
                btnBrowse.click();
            } catch(e) {
                document.getElementById("console").className="error";
                document.getElementById("console").innerHTML = e.toString();
            }
        }
        function keyListener(e) {
            e = e || window.event;
            if (e.keyCode == 13) {
                doUrlMeasure();
            }
        }
        function showMoreDiv() {
            document.getElementById("moreDiv").style.display = "block";
        }
        function hideMoreDiv() {
            document.getElementById("moreDiv").style.display = "none";
        }
    </script>
    <div class="wait" id="waitDiv" style="display: none">
        <div style="position: absolue; bottom: 50%;">
            <center>wait...</center>
            <img src="data:image/jpeg;base64," width="100%" height="100%">
        </div>
    </div>
    <body>
        <div id="mainDiv">
            <input type="file" id="btnBrowse" style="visibility:hidden" accept="*.*"/>
            <center>
                <img src="data:image/jpeg;base64,">
                <div class="info">
                    <h1>Codeometer</h1>
                </div>
                <table border = 0 style="font-family: Courier">
                    <tr>
                        <td>
                            <input type="text" id="edtQuery" size=100 placeholder="Type a git-repo url and click measure or click open and select a zipped project or a source file." onkeydown="keyListener(event);">
                        </td>
                        <td>
                            <input type="button" id="btnMeasure" size=20 value="Measure" onclick="doUrlMeasure();">
                        </td>
                        <td>
                            <input type="button" id="btnUpload" size=20 value="Open..." onclick="doFileMeasure();">
                        </td>
                        <td>
                            <input type="button" id="btnUpload" size=20 value="Config..." onclick="showMoreDiv();">
                        </td>
                    </tr>
                </table>
                <div id="moreDiv" style="display: none; font-family: Courier">
                    <table border = 0>
                        <tr>
                            <td>
                                <input type="text" id="edtExt" size=76% placeholder="Type all relevant file extensions present in the project (eg.: c,h,etc).">
                            </td>
                            <td>
                                <input type="checkbox" id="chkEstimatives"> Estimatives
                            </td>
                            <td>
                                <input type="checkbox" id="chkStatsPerFile"> Stats per file
                            <td>
                                <input type="button" id="btnOk" size=20 value="Ok" onclick="hideMoreDiv();">
                            </td>
                        </tr>
                    </table>
                </div>
            </center>
            <div class="info" id="console">
                <p align="justify">
                    {{.info}}
                </p>
            </div>
       </div>
       <div class="copyright">
               <div class="copyright-disclaimer">
                   (C) Copyright 2020 by Rafael Santiago
               </div>
       </div>
    </body>
</html>
`

type CodeometerHandlerFunc func()int

type CodeometerCommandHandler struct {
    Runner CodeometerHandlerFunc
    Helper CodeometerHandlerFunc
}

func commands() map[string]CodeometerCommandHandler {
    return map[string]CodeometerCommandHandler {
        "measure" : CodeometerCommandHandler{measure, measureHelp},
        "httpd" : CodeometerCommandHandler{httpd, httpdHelp},
        "man" : CodeometerCommandHandler{man, manHelp},
        "version" : CodeometerCommandHandler{version, versionHelp},
        "help" : CodeometerCommandHandler{help, showHelpBanner},
        "" : CodeometerCommandHandler{showHelpBanner, showHelpBanner},
    }
}
